def send(socket: socket.socket, data:str, escape=True, reset=True):
    if reset:
        data += "[0m"
    if escape:
        data += '\r\n'
    socket.send(data.encode())

def ping():
    while 1:
        dead_bots = []
        for bot in bots.keys():
            try:
                bot.settimeout(10)
                send(bot, 'PING', False, False)
                if bot.recv(1024).decode() != 'PONG':
                    dead_bots.append(bot)
            except:
                dead_bots.append(bot)
            
        for bot in dead_bots:
            bots.pop(bot)
            bot.close()
        time.sleep(5)

